import React from "react";
import SearchBar from "../SearchBar";
import { Link } from "react-router-dom";

const Nav = ({onSearch}) => {

return (
    <div>
         <SearchBar onSearch={onSearch} />

         <link to="/about">
    <button>About</button>
    </link> 
    <link to="/home">
    <button>Home</button>
    </link> 
         
    </div>
)
}

export default Nav;
